//SPDX-License-Identifier: MIT
/**
 * proponData   -
 *               Solidity Contract for Pro-pon application
 *               July/2022
 *               Author: Roberto VicuÃ±a
 * 
 *              PropoData contract holds all the information for Pro-pon dApp.
 *              It aims to host data concerning processes of RFP of companies registered with contract: RFPs, its Documents and Company metadata
 *              ther are two main adresses: Owner and Manager
 *              Owner is the address of companion contract ProponLogic which  has W/R rigths on data structures
 *              Manager is the addres of deployer that can set prices variables for different operations
 *              Destruction of contract is only allowed for Manager
 * 
 */
pragma solidity ^0.8.9;

import "./proponShared.sol";

//import "hardhat/console.sol";

// Pro-pon Data contract. Keeps track of companies and RFP contests
contract pro_ponData is proponShared {
    //Owner authorized to make changes to data (must be Propon Logic contract address)
    address private owner;

    // Manager authorized to set constants values and detroy contract
    address private manager;

    // A company must pay to get recorder into system
    uint256 public CREATE_COMPANY_PRICE = 0.0001 ether;

    // A company creating an RFP pays for publishing it and for uploading its files
    uint256 public CREATE_OPEN_RFP_PRICE = 0.0001 ether;

    // A company creating an Invitation RFP pays for publishing it for uploading its files and
    // for  guests companies to upload their files (there is a limit on invited companies allowed)
    uint256 public CREATE_INVITATION_RFP_PRICE = 0.0002 ether;

    // A company registering to participate in an RFP pays for that and  for uploading its  files
    uint256 public REGISTER_OPEN_RFP_PRICE = 0.0001 ether; // how much a company must pay to get into an Open RFP

    // a limit on how many companies can register to an Open Contest
    uint public MAX_GUEST_OPEN_TENDER = 10; // set to 5 for contract unit testing, 25 for broser access/production

    // a limit on how many companies can a company registering an Invitation Contest can register
    uint public MAX_GUEST_INVITATION_TENDER = 10; // set to 5 for contract unit testing, 25 for broser access/production

    uint16 private currentRFPIdx = 0; // global that keeps track of all RFPs issued by all companies a limit of 65,535 RFPs exists

    // Companies in the system. Address of admin of company. User can't loose this address because company data would be lost
    mapping(address => Company) Companies;

    // Hold a map from ids to companies to easliy check uniqueness of company ID
    mapping(string => bool) CompanyidTaken; // It would be set to true for Company Id string if exists

    // All RFPs in the system, they map from an index given by currentRFPIdx
    mapping(uint16 => RFP) public RFPs;

    // RFPDocuments  maps an RFP index to a Document
    mapping(uint16 => Document[]) RFPDocuments;

    // Record of used RFP Id by an address issuer of RFP, to guarantee uniqueness of RFP ID by Accounts RFP's Issuers
    mapping(bytes32 => bool) RfpIds;

    // Modifiers ***************************************************************
    // only owner can do Company & Documents & RFP data changing tasks: Setting Companies, RFPs and Documents
    // this Owner is always set to the current proponLogic contract, that will control writing data to Data Contract
    modifier onlyOwner() {
        require(msg.sender == owner, "only_owner_allowed");
        _;
    }

// only owner can do administrative tasks: Setting Prices, setting owner and destroy contract
// is set to the external account that controls the contract
    modifier onlyManager() {
        require(msg.sender == manager, "only_manager_allowed");
        _;
    }

    constructor() {
        owner = msg.sender;
        manager = msg.sender;
    }

    // getters/setters

    //**********************Setters ***************************************** */

    function setOwner(address _newOwner) external onlyOwner {
        owner = _newOwner;
    }

    function setManager(address _newManager) external onlyManager {
        manager = _newManager;
    }

    // Variables of capacity and price

    function setCreateCompanyPrice(uint256 _value) external onlyManager {
        CREATE_COMPANY_PRICE = _value;
    }

    function setCreateOpenRfpPrice(uint256 _value) external onlyManager {
        CREATE_OPEN_RFP_PRICE = _value;
    }

    function setCreateInvitationRfpPrice(uint256 _value) external onlyManager {
        CREATE_INVITATION_RFP_PRICE = _value;
    }

    function setRegisterOpenRfpPrice(uint256 _value) external onlyManager {
        REGISTER_OPEN_RFP_PRICE = _value;
    }

    function setMaxGuestOpenTender(uint _value) external onlyManager {
        MAX_GUEST_OPEN_TENDER = _value;
    }

    function setMaxGuestInvitationTender(uint _value) external onlyManager {
        MAX_GUEST_INVITATION_TENDER = _value;
    }

    // Entities setters **********************
    function setCompany(
        address companyAddress,
        string memory _id,
        string memory _name,
        string memory _country
    ) external onlyOwner {
        Company storage company = Companies[companyAddress];
        company.id = _id;
        company.name = _name;
        company.country = _country;

        // also update the CompanyidTaken mapping
        CompanyidTaken[_id] = true;
    }

    // The  pair parameter is a juxtaposition of company admin address and RFP id
    //  and looks to prevent a company to use  the same RFP ID twice
    function setRfpId(bytes32 pair) external onlyOwner {
        RfpIds[pair] = true;
    }

    function setRFP(uint16 rfpIdx, RFP memory rfp) external onlyOwner {
        RFPs[rfpIdx] = rfp;
    }

    // other modifying entitiies functions

    function incrementRFPIdx() external onlyOwner {
        currentRFPIdx += 1;
    }

    function addCompanyRFP(
        address companyAddress,
        uint16 rfpIdx
    ) external onlyOwner {
        Companies[companyAddress].company_RFPs.push(rfpIdx);
    }

    function addParticipantToRFP(
        uint16 rfpId,
        address participant
    ) external onlyOwner {
        RFPs[rfpId].participants.push(participant);
    }

    function setRFPCanceled(uint16 _rfpIndex, bool _canceled) external {
        RFPs[_rfpIndex].canceled = _canceled;
    }

    function setRFPCancelDate(uint16 _rfpIndex, uint256 _cancelDate) external {
        RFPs[_rfpIndex].cancelDate = _cancelDate;
    }

    function addDocument(
        uint16 _rfpIdx,
        uint _docType,
        string memory _name,
        address _owner,
        string memory _documentHash,
        string memory _idx
    ) external onlyOwner {
        Document memory newDocument = Document(
            _docType,
            _name,
            _owner,
            _documentHash,
            _idx
        );
        RFPDocuments[_rfpIdx].push(newDocument);
    }

    function addWinnersToRFP(
        uint16 _rfpIndex,
        address[] memory winners
    ) external onlyOwner {
        RFPs[_rfpIndex].winners = winners;
    }

    function addCompanyParticipationinRFP(
        uint16 _rfpIndex,
        address company
    ) external onlyOwner {
        Companies[company].RFPParticipations.push(_rfpIndex);
    }

    function acrueWinsToCompany(
        uint16 _rfpIndex,
        address[] memory winners
    ) external onlyOwner {
        uint numberOfWinners = winners.length;
        for (uint i = 0; i < numberOfWinners; i++) {
            Companies[winners[i]].RFPsWins.push(_rfpIndex);
        }
    }



    //**************************Getters ******************************** */

    // pointer in structures for adding RFPs, it increases for each RFP added
    function getcurrentRFPIdx() external view returns (uint16) {
        return (currentRFPIdx);
    }

    // returns current address owner
    function getOwner() external view returns (address) {
        return owner;
    }

    // returns current address manager
    function getManager() external view returns (address) {
        return manager;
    }

    function getCancelDate(uint16 _rfpIndex) public view returns (uint) {
        return RFPs[_rfpIndex].cancelDate;
    }

    // Company Getters  ----------------------------------------

    // returns current id of company for companyAddress owner
    function getCompanyId(
        address companyAddress
    ) external view returns (string memory) {
        return Companies[companyAddress].id;
    }

    // returns whole  company record for admin address
    function getCompany(
        address adminaddress
    ) external view returns (Company memory) {
        return Companies[adminaddress];
    }

    // returns creation company price
    // function getCreateCompanyPrice() external view returns (uint256) {
    //     return CREATE_COMPANY_PRICE;
    // }

    function isCompanyIdTaken(
        string calldata _id
    ) external view returns (bool) {
        return CompanyidTaken[_id];
    }

    function getWinners(
        uint16 _rfpIndex
    ) public view returns (address[] memory) {
        return RFPs[_rfpIndex].winners;
    }

    function getCompanyWins() public view returns (uint16[] memory) {
        return Companies[msg.sender].RFPsWins;
    }

    function getCompanyRFPs(
        address account
    ) public view returns (uint16[] memory) {
        return Companies[account].company_RFPs;
    }

    //   RFP Getters  ----------------------------------------

    // getRFPbyIndex receive an index and returns the RFP if exists
    function getRFPbyIndex(uint16 _rfpId) public view returns (RFP memory) {
        return RFPs[_rfpId];
    }

    // returns current issuer address of rfpIdx RFP
    function getRFPIssuer(uint16 rfpIdx) external view returns (address) {
        return RFPs[rfpIdx].issuer;
    }

    // returns current status of rfpIdx RFP
    function isRFPCanceled(uint16 rfpIdx) external view returns (bool) {
        return RFPs[rfpIdx].canceled;
    }

    // get the boolean value telling if combination of address and rfp id has been used
    function getRfpIds(bytes32 pair) external view returns (bool) {
        return RfpIds[pair];
    }

    // Document Getters
    function getDocumentsfromRFP(
        uint16 _rfpIdx
    ) external view returns (Document[] memory) {
        return (RFPDocuments[_rfpIdx]);
    }

    // final device to kill contract - escape function for live testing, any funds go to owner contract
    function destroy() public onlyManager {
        selfdestruct(payable(owner));
    }

}

contracts/proponLogic.sol.content:
//SPDX-License-Identifier: MIT
/**
 * pro-pon   -
 *               Solidity Contract for Pro-pon application
 *               July/2022
 *               Author: Roberto VicuÃ±a
 */
pragma solidity ^0.8.9;

import "./proponData.sol";
import "./proponShared.sol";

//import "hardhat/console.sol";

// Pro-pon Logic contract. Validates access and modify data on pro_ponData contract Data structures
contract pro_ponLogic is proponShared {
    pro_ponData dataContract; // pro_ponData.sol is the Contract that holds all Pro-pon data, constants, structs, vars
    address private owner;


    constructor(address _dataContractAddress) payable {
        dataContract = pro_ponData(_dataContractAddress);
        owner = payable(msg.sender);
    }

    // Events

    // event to send when an RFP has been created
    event NewRFPCreated(address indexed sender, uint16 id, string name);

    // Modifiers ***************************************************************
    // only owner can do administrative task as withdrawing
    modifier onlyOwner() {
        require(msg.sender == owner, "Only_owner_allowed");
        _;
    }

    // only admin of  company can do task on its company (with companyId)
    // it checks that the registered Id of sender is actually the one sended in the params
    // i.e. a company can't pretend to be another company
    modifier onlyCompanyAdmin(string memory companyId) {
        require(
            equals(dataContract.getCompanyId(msg.sender), companyId),
            "Only_admin_can_perform"
        );
        _;
    }

    // only issuer of Invitation RFP can perfrom
    // validates the RFP was actually issued by whomever sender is trying to modify RFP
    modifier onlyIssuer(uint16 rfpIdx) {
        require(
            dataContract.getRFPIssuer(rfpIdx) == msg.sender,
            "Only_issuer_can_perform"
        );
        _;
    }

    modifier rfpCancelled(uint16 rfpIdx) {
        require(!dataContract.isRFPCanceled(rfpIdx), "already_canceled");
        _;
    }

    // retire funds to owner account
    function withdraw() public onlyOwner {
        uint256 amount = address(this).balance;
        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "failed_withdraw");
    }

    // Getter/setters ***************************************************************

    // Variables of capacity and price
    function setOwner(address _newOwner) external onlyOwner {
        owner = _newOwner;
    }

    function getOwner() external view  returns (address) {
        return owner;
    }
    function transferDataContractOwnership(address _newAddress) external onlyOwner {
        dataContract.setOwner(_newAddress);
    }


    // utility functions ***************************************************************
    function equals(
        string memory a,
        string memory b
    ) private pure returns (bool) {
        if (bytes(a).length != bytes(b).length) {
            return false;
        } else {
            return
                keccak256(abi.encodePacked(a)) ==
                keccak256(abi.encodePacked(b));
        }
    }

    // concatStringAndAddress
    //        - Concatenate a string and an address, hash the concatenated result and create a mapping to a bool
    function concatStringAndAddress(
        string memory _string,
        address _address
    ) private pure returns (bytes32) {
        bytes32 stringhashed = keccak256(bytes(_string));
        bytes memory concatString = abi.encodePacked(stringhashed, _address);
        bytes32 hash = keccak256(concatString);
        return hash;
    }

    // winnerIsParticipatingorZero
    //       check if the passed address is also present in array targetAddreses
    //       A 0 address is also checked as this is considered a 'deserted' item
    function winnerIsParticipatingorZero(
        address addresstoCheck,
        address[] memory targetAddresses
    ) private pure returns (bool) {
        if (targetAddresses.length == 0) {
            // there is not participants, onvly valid winner is address(0) (this is: deserted)
            return (addresstoCheck == address(0));
        }
        for (uint i = 0; i < targetAddresses.length; i++)
            if (
                addresstoCheck == targetAddresses[i] ||
                addresstoCheck == address(0)
            ) return true; // account for deserted Items
        return false;
    }

function isInArray(address[] memory arr, address value, uint8 count) internal pure returns (bool) {
    for (uint8 i = 0; i < count; i++) {
        if (arr[i] == value) {
            return true;
        }
    }
    return false;
    }


    // Company functions ************************************************************
    function createCompany(
        string memory _id,
        string memory _name,
        string memory _country
    ) public payable {
        // check the ID  is not taken yet
        require(!dataContract.isCompanyIdTaken(_id), "id_already_exists");
        // check there is payment on tx
        require(
            msg.value >= dataContract.CREATE_COMPANY_PRICE(),
            "Insufficient_payment"
        );
        // check this address has not been used before (ony one address is admin of company)
        bytes memory checkId = bytes(dataContract.getCompanyId(msg.sender)); // Uses memory
        require(checkId.length == 0, "address_already_admin_of_company");
        //all ok, proceed to add company data
        dataContract.setCompany(msg.sender, _id, _name, _country);
    }

    // RFP  functions *****************************************************************

    //      The sender creates an RFP. A record RFP is create and mapped from the current RFPIndex (currentRFPIdx)
    //      to the new record and the index is added to company array or RFPs
    //      Validates date is not older than today minus 1 hour to accmodate UX/UI delays to send the data
    //      Validates dates correct sequence
    //      It contains all data in the mirror DataBase except the autogenerated _id MongoDb Id record
    function createRFP(
        string memory _name,
        string memory _description,
        string memory _rfpwebsite,
        uint _openDate,
        uint _endReceivingDate,
        uint _endDate,
        proponShared.ContestType _contestType,
        string[] memory _items
    ) public payable {
        // check this RFP ID is unique for this address, revert if found an equal Id
        bytes32 pair = concatStringAndAddress(_name, msg.sender);
        require(!dataContract.getRfpIds(pair), "rfpid_already_taken");
        // check TX is sufficiently funded
        require(
            msg.value >=
                (
                    _contestType == proponShared.ContestType.OPEN
                        ? dataContract.CREATE_OPEN_RFP_PRICE()
                        : dataContract.CREATE_INVITATION_RFP_PRICE()
                ),
            "Insufficient_payment"
        );
        // verify this address is from a compay admin retrieving his company record
        proponShared.Company memory company = dataContract.getCompany(
            msg.sender
        );
        bytes memory chekString = bytes(company.id);
        require(bytes(chekString).length != 0, "address_not_admin"); // this address is not admin
        // Next sentence that was disable for developing and testing is
        require(_openDate >= (block.timestamp - 3600), "opendate_behind_today"); // allow one hour behind!
        require(_openDate < _endReceivingDate, "initial_date_wrong");
        require(_endReceivingDate < _endDate, "receiving_date_wrong");
        uint16 currRFPIdx = dataContract.getcurrentRFPIdx();
        RFP memory newRFP = RFP(
            _name, // in UI/UX is the Id of RFP
            _description, // in UI/UX is the name of RFP
            currRFPIdx, // RFP's Global Index
            _rfpwebsite,
            _openDate,
            _endReceivingDate,
            _endDate,
            false,
            0,
            new address[](0),
            _contestType,
            _items,
            new address[](0),
            msg.sender
        );
        dataContract.setRfpId(pair); // Assume this setter exists, it sets RfpIds[pair] to true
        dataContract.setRFP(currRFPIdx, newRFP); // Assume this setter exists
        dataContract.addCompanyRFP(msg.sender, currRFPIdx); // Assume this setter exists
        dataContract.incrementRFPIdx();
        emit NewRFPCreated(msg.sender, currRFPIdx, _name);
    }

    /**
     * inviteCompaniestoRFP add companies Id to invited array of the  RFP (onlyRFPOwner)
     *  _rfpId - ID of RFP on RFPs
     *  companyId - Id of company owner of RFP
     *  invitedCompanies - Addresses of admin of invited Company
     *  only register if company is not already in RFP or is the owner, silently ignore such companies addresses
     */
    function inviteCompaniestoRFP(
        uint16 _rfpId, // index in All RFP array RFPs
        string memory companyId, // id of company owner of RFP
        address[] memory invitedCompanies
    )
        public
        onlyCompanyAdmin(companyId)
        onlyIssuer(_rfpId)
        rfpCancelled(_rfpId)
    {
        RFP memory rfp = dataContract.getRFPbyIndex(_rfpId);
        require(
            rfp.contestType == ContestType.INVITATION_ONLY,
            "wrong_contest_type"
        );
        require(
            rfp.endReceivingDate > block.timestamp,
            "end_receiving_reached"
        );
        require(
            (rfp.participants.length + invitedCompanies.length) <=
                dataContract.MAX_GUEST_INVITATION_TENDER(),
            "too_many_guests"
        );
        uint8 invitedComplen = uint8(invitedCompanies.length);
        for (uint8 j = 0; j < invitedComplen; j++) {
            bool validAddress = true;
            if (msg.sender == invitedCompanies[j]) {
                continue; // silently ignore if owner trying to invite itself bypassing it
            }
            // check current company address with already invited companies to the RFP
            uint8 lenParticipants = uint8(rfp.participants.length);
            for (uint8 i = 0; i < lenParticipants; i++) {
                if (rfp.participants[i] == invitedCompanies[j]) {
                    validAddress = false; // if already invited silently ignore it bypassing it
                    break;
                }
            }
            if (validAddress) {
                dataContract.addParticipantToRFP(_rfpId, invitedCompanies[j]);
                dataContract.addCompanyParticipationinRFP(
                    _rfpId,
                    invitedCompanies[j]
                );
            }
        }
    }

    // Register sender as participating in an Open RFP
    // rejects and revert  if address already in list of registered participants
    // reject if limit  MAX_GUEST_OPEN_TENDER  has already been reached
    function registertoOpenRFP(
        uint16 _rfpId
    ) public payable rfpCancelled(_rfpId) {
        RFP memory rfp = dataContract.getRFPbyIndex(_rfpId);
        require(
            msg.value >= dataContract.REGISTER_OPEN_RFP_PRICE(),
            "Insufficient_payment_fee"
        );
        //disable
        require(rfp.contestType == ContestType.OPEN, "not_open_tender");
        require(
            rfp.endReceivingDate > block.timestamp,
            "end_receiving_reached"
        );
        require(msg.sender != rfp.issuer, "can_not_register_self");
        require(
            rfp.participants.length < dataContract.MAX_GUEST_OPEN_TENDER(),
            "max_participants_reached"
        );
        uint8 numberofParticipants = uint8(rfp.participants.length);
        for (uint8 i = 0; i < numberofParticipants; i++) {
            require(rfp.participants[i] != msg.sender, "already_participating");
        }
        dataContract.addParticipantToRFP(_rfpId, msg.sender);
        dataContract.addCompanyParticipationinRFP(_rfpId, msg.sender);
    }

    // New method Pro-pon v 0.2.0
    // add several documents in one call all of them belonging to same RFPId and same DocType
    function addDocuments(
        uint16 _rfpIdx,
        uint[] memory _docTypes,
        string[] memory _names,
        string[] memory _documentHashes,
        string[] memory _idxs
    ) public {
        // check all arrays are same size
        require(
            _docTypes.length == _names.length &&
                _names.length == _documentHashes.length &&
                _documentHashes.length == _idxs.length,
            "input_array_lengths_no_match"
        );
        RFP memory rfp = dataContract.getRFPbyIndex(_rfpIdx);
        bool rfpOwner = msg.sender == rfp.issuer;
        // if not RFP owner, check the sender is in participants list
        if (!rfpOwner) {
            bool isIncluded = false;
            uint numberofParticipants = rfp.participants.length;
            for (uint j; j < numberofParticipants; j++) {
                if (msg.sender == rfp.participants[j]) {
                    isIncluded = true;
                    break;
                }
            }
            require(isIncluded, "not_participant");
        }
        // Iterate over each document metadata sent
        bool docOwnerAllowedTypes = false;
        uint8 namesLength = uint8(_names.length);
        for (uint8 i = 0; i < namesLength; i++) {
            //  if sender is owner of RFP, check  current Doc has not invalid doctypes
            // owner of RFP only can upload request, Q&A and contract tpe  docs, and else check
            // for participant to not sent those Types
            uint8 docType = uint8(_docTypes[i]);
            docOwnerAllowedTypes = (docType ==
                uint8(DocType.documentRequestType) ||
                docType == uint8(DocType.documentQandAType) ||
                docType == uint8(DocType.documentAmendment));
            if (rfpOwner) require(docOwnerAllowedTypes, "issuer_bad_doctype");
            else {
                // a participant uplaoding docs, is allowed?
                require(!docOwnerAllowedTypes, "participant_bad_doctype");
                // is on time?
                require(
                    rfp.endReceivingDate > block.timestamp,
                    "end_receiving_reached"
                );
            }
            // so far so good, push it to contract state
            dataContract.addDocument(
                _rfpIdx,
                _docTypes[i],
                _names[i],
                msg.sender,
                _documentHashes[i],
                _idxs[i]
            );
        }
    }

    // declareWinners
    //  Register all account addresess of winners for Items of an RFP or for the whole RFP if no Items (at index 0 of winners array)
    //  _rfpIndex - Global Id of RFP
    //  _companyId  - Id of RFP Issuing company
    //  winners  - array with winners addresses. If a winner is an addres 0x then the RFP or Item was declared deserted
    function declareWinners(
        uint16 _rfpIndex,
        string memory _companyId,
        address[] memory winners
    )
        public
        onlyCompanyAdmin(_companyId)
        onlyIssuer(_rfpIndex)
        rfpCancelled(_rfpIndex)
    {

        // first check conditions are met
        RFP memory rfp = dataContract.getRFPbyIndex(_rfpIndex);
        require(rfp.winners.length == 0, "rfp_already_awarded"); // Awarding only once is allowed
        require(!rfp.canceled, "already_canceled");
        uint8 itemsLength = uint8(rfp.items.length);
        uint8 winnersLength = uint8(winners.length);
        // RFPs with no items or 1 itme should have equally one winner
        require(
            ((itemsLength == 0 || itemsLength == 1) && winners.length == 1) ||
                (itemsLength >= 2 && winnersLength == itemsLength),
            "not_matching_winners"
        );
        require(block.timestamp >= rfp.endDate, "enddate_not_reached_yet");
        // other solutions were exploore to avoid defining a new uniqueWinners but implied to have  acontract starte var
        // that could potential present problems with race conditions so here is a expensier creation of a new array but safer
        address[] memory uniqueWinners = new address[](winners.length);
        uint8 uniqueCount = 0;        
        for (uint8 i = 0; i < winnersLength; i++) {
            address winner = winners[i];
            require(winner != msg.sender, "cannot_self_award");
            require(
                winnerIsParticipatingorZero(winner, rfp.participants),
                "invalid_winner"
            );
            if (!isInArray(uniqueWinners, winner, uniqueCount)) {
                if (winner != address(0)) {
                    uniqueWinners[uniqueCount] = winner;
                    uniqueCount++;
                }
            }
        }

        address[] memory finalUniqueWinners = new address[](uniqueCount);
        for(uint8 i = 0; i < uniqueCount; i++) {
            finalUniqueWinners[i] = uniqueWinners[i];
        }
        dataContract.addWinnersToRFP(_rfpIndex, winners);
        dataContract.acrueWinsToCompany(_rfpIndex, finalUniqueWinners);
    }

    function cancelRFP(
        string memory _companyId,
        uint16 _rfpIndex
    )
        public
        onlyCompanyAdmin(_companyId)
        onlyIssuer(_rfpIndex)
        rfpCancelled(_rfpIndex)
    {
        RFP memory rfp = dataContract.getRFPbyIndex(_rfpIndex);
        require(rfp.winners.length == 0, "rfp_already_awarded"); // can't cancel if already awarded
        dataContract.setRFPCanceled(_rfpIndex, true);
        dataContract.setRFPCancelDate(_rfpIndex, block.timestamp);
    }

    function destroy() public onlyOwner {
        selfdestruct(payable(owner)); // always send funds to owner as in withdraw function
    }

}

contracts/proponShared.sol.content:
//SPDX-License-Identifier: MIT
//pragma solidity >=0.7.0 <0.9.0;
pragma solidity ^0.8.9;

/**proponShared Contract
 * Holds enums & structs used by proponData and proponLogic that can't be passed as imports from Data to Logic contracts
 *      proponData.sol
 *      proponLogic.sol
 */

contract proponShared {
    /* ContestType - Enumeration of type of RFP
            Open allow any company to participate, it will have a owner define participants limit
*/
    enum ContestType {
        OPEN,
        INVITATION_ONLY
    }

    /* DocType Enumeration defining type of documents associated with RFP
     */
    enum DocType {
        documentRequestType, // RFP doc  from Owner
        documentQandAType, // Clarification Questions and answers from Owner
        documentAmendment, // Contract, adenda, guaranties etc documents created between owner and winners
        documentProposalType, // Technical offering, RFPs answers from participant
        documentPricingOfferingType, // Economic Proposal from participant
        documentLegalType, // Legal documents from participants
        documentFinancialType, // Financial statements and documents from participants
        documentAdministrativeType, // Administrative documents from participants
        // Documents post RFP. These are for future versions where follow up of RFP Documents like contracts
        // Project progress reports, informs etc
        documentContract, // Contract documents
        documentAnnex, // Annexes document to contracts
        documentPProgress // Status and progress reports
    }

    // Company. Records all companies in Pro-pon contract
    struct Company {
        string id;
        string name;
        string country;             // 3-code int'l country code
        uint16[] RFPParticipations; // How many RFP the company has partipated as invited / self-registered
        uint16[] RFPsWins;          // Global Ids of RFPs this company has won or won one or more items from
        uint16[] company_RFPs;      // array of RFPs issued by this company
    }

    // RFP. Record of RFP contests issued by companies in Pro-pon contract
    struct RFP {
        string name; // In UI/UX  is the ID of the RFP
        string description; // In UI/UX  is the name of the RFP
        uint16 rfpIndex; // Global Id for this RFP  (in RFPs array)
        string rfpwebsite; // Company web page for the RFP
        uint openDate; // date when start receiving proposals
        uint endReceivingDate; // date when finish  receiving proposals
        uint endDate; // date when password of proposals is released
        bool canceled; // the contest was called off, no proposal was satisfactory
        uint cancelDate; // Date the contest was canceled
        address[] participants; // Keep tracks of invited/participant companies to this RFP, store companies ID
        proponShared.ContestType contestType;
        string[] items; // Optional, the name of different requesting groups of items asked for
        // each item can have a different winner
        address[] winners; // address of winner of each item (if no Items RFP winner is in winner[0])
        address issuer; // Reference back to company issuing this RFP
    }

    // Documents. Record of RFP Proposal Documents metadata
    struct Document {
        uint docType;       // 0 is a requesting RFP Doc/  1 is a Response RFP Doc
        string name;
        address owner;      // of the document
        string documentHash; // act as unique id
        string idx;         // Id storage on arweave (https://arweave.net/{idx})
    }
}

